class AccessObject:

    def __init__(self, accessobject=None):
        self.com_object= accessobject

    @property
    def CurrentView(self):
        return AcCurrentView(self.com_object.CurrentView)

    @property
    def currentview(self):
        """Lower case alias for CurrentView"""
        return self.CurrentView

    @property
    def DateCreated(self):
        return self.com_object.DateCreated

    @property
    def datecreated(self):
        """Lower case alias for DateCreated"""
        return self.DateCreated

    @property
    def DateModified(self):
        return self.com_object.DateModified

    @property
    def datemodified(self):
        """Lower case alias for DateModified"""
        return self.DateModified

    @property
    def FullName(self):
        return self.com_object.FullName

    @FullName.setter
    def FullName(self, value):
        self.com_object.FullName = value

    @property
    def fullname(self):
        """Lower case alias for FullName"""
        return self.FullName

    @fullname.setter
    def fullname(self, value):
        """Lower case alias for FullName.setter"""
        self.FullName = value

    @property
    def IsLoaded(self):
        return self.com_object.IsLoaded

    @property
    def isloaded(self):
        """Lower case alias for IsLoaded"""
        return self.IsLoaded

    @property
    def IsWeb(self):
        return self.com_object.IsWeb

    @property
    def isweb(self):
        """Lower case alias for IsWeb"""
        return self.IsWeb

    @property
    def Name(self):
        return self.com_object.Name

    @property
    def name(self):
        """Lower case alias for Name"""
        return self.Name

    @property
    def Parent(self):
        return self.com_object.Parent

    @property
    def parent(self):
        """Lower case alias for Parent"""
        return self.Parent

    @property
    def Properties(self):
        return AccessObjectProperties(self.com_object.Properties)

    @property
    def properties(self):
        """Lower case alias for Properties"""
        return self.Properties

    @property
    def Type(self):
        return AcObjectType(self.com_object.Type)

    @property
    def type(self):
        """Lower case alias for Type"""
        return self.Type

    def GetDependencyInfo(self):
        return DependencyInfo(self.com_object.GetDependencyInfo())

    # Lower case alias for GetDependencyInfo
    def getdependencyinfo(self):
        return self.GetDependencyInfo()

    def IsDependentUpon(self, ObjectType=None, ObjectName=None):
        arguments = com_arguments([unwrap(a) for a in [ObjectType, ObjectName]])
        return self.com_object.IsDependentUpon(*arguments)

    # Lower case alias for IsDependentUpon
    def isdependentupon(self, ObjectType=None, ObjectName=None):
        arguments = [ObjectType, ObjectName]
        return self.IsDependentUpon(*arguments)


class AccessObjectProperties:

    def __init__(self, accessobjectproperties=None):
        self.com_object= accessobjectproperties

    @property
    def Application(self):
        return self.com_object.Application

    @property
    def application(self):
        """Lower case alias for Application"""
        return self.Application

    @property
    def Count(self):
        return self.com_object.Count

    @property
    def count(self):
        """Lower case alias for Count"""
        return self.Count

    def Item(self, Index=None):
        arguments = com_arguments([unwrap(a) for a in [Index]])
        if hasattr(self.com_object, "GetItem"):
            return self.com_object.GetItem(*arguments)
        else:
            return self.com_object.Item(*arguments)

    def item(self, Index=None):
        """Lower case alias for Item"""
        arguments = [Index]
        return self.Item(*arguments)

    @property
    def Parent(self):
        return self.com_object.Parent

    @property
    def parent(self):
        """Lower case alias for Parent"""
        return self.Parent

    def Add(self, PropertyName=None, Value=None):
        arguments = com_arguments([unwrap(a) for a in [PropertyName, Value]])
        self.com_object.Add(*arguments)

    # Lower case alias for Add
    def add(self, PropertyName=None, Value=None):
        arguments = [PropertyName, Value]
        return self.Add(*arguments)

    def Remove(self, Item=None):
        arguments = com_arguments([unwrap(a) for a in [Item]])
        self.com_object.Remove(*arguments)

    # Lower case alias for Remove
    def remove(self, Item=None):
        arguments = [Item]
        return self.Remove(*arguments)


